'customer strict';
const {
  Model
} = require('sequelize');
module.exports = (sequelize, DataTypes) => {
  class Customer extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
      // define association here
      Customer.belongsTo(models.User, { foreignKey: 'userId', targetKey: 'id', as: 'user' })
    }
  }
  Customer.init(
    {
      name: DataTypes.STRING,
      phone: DataTypes.STRING,
      email: DataTypes.STRING,
      note: DataTypes.STRING,
      userId: DataTypes.STRING,
      estimatedCosts: {
        type: DataTypes.FLOAT, // Đặt kiểu dữ liệu phù hợp với ước tính của bạn
        allowNull: true, // Hoặc false nếu bạn không muốn chấp nhận giá trị null
        defaultValue: null, // Giá trị mặc định nếu không có giá trị được cung cấp
      },
    },
    {
      sequelize,
      modelName: "Customer",
    }
  );
  

  return Customer;
};

